            function searchBox(characterbox, data){
                var filterData = []
                
                for(var i = 0; i < data.length; i++){
                    characterbox = characterbox.toLowerCase()
                    var Name = data[i].Name.toLowerCase()

                    if(Name.includes(characterbox)){
                        filterData.push(data[i])
                    }
                }
                return filterData
            }
        
        
        
            function buildTable(data){
                var table = document.getElementById('switchTable')
                table.innerHTML = 'Check console for any errors'
                for (var i = 0; i < data.length; i++){
                    var row = `<tr>
                                    <td>${data[i].Name}</td>
                                    <td>${data[i].ID}</td>
                              </tr>`
                    table.innerHTML += row
        
        
                }
            }
